import React, { Fragment } from "react"
import {childRender} from "../../router/index"
import {NavLink, Switch, Route} from "react-router-dom"
import ChildNav from "../../component/childNav"
function Index(){
    return(
        <Fragment>
            <ChildNav/>
            <Switch>
                {childRender.map((item,index)=>{
                    return(
                        <Route
                            key={index}
                            path={item.path}
                            exact={item.exact}
                            render={(props)=>{
                                return item.render(props)
                            }}
                        ></Route>
                    )
                })}
            </Switch>
        </Fragment>
    )
}

export default Index
